/**
 * @fileoverview The interface for an object that can be disposed of when the
 *     workspace is disposed of.
 * @author aschmiedt@google.com (Abby Schmiedt)
 */

'use strict';

goog.provide('Blockly.IDisposable');


/**
 * The interface for an object that can be disposed of when the workspace is disposed of.
 * @interface
 */
Blockly.IDisposable = function() {};

/**
 * Disposes of the plugin. Should completely clean up after the plugin.
 * @return {void}
 */
Blockly.IDisposable.prototype.dispose;
